const initState = {
    profileDetails: null
}

const profileReducer = (state = initState, action) => {
  switch (action.type) {
    case 'UPDATE_PROFILE':
      console.log("Profile: ", action.profileDetails)
      return state
    case 'UPDATE_PROFILE_ERR':
      console.log("ProfileErr: ", action.err)
      return state
  }
}

export default profileReducer
